import React from "react";

//Styled Components
import { Title } from "../styledComponents/title";
import { MainContainer } from "../styledComponents/mainContainer";
import { GoodThingContainerBirdLeft } from "../styledComponents/goodThingContainerBirdLeft";
import { GoodThingContainerBirdRight } from "../styledComponents/goodThingContainerBirdRight";
import { Button } from "../styledComponents/button";
import { HighlightedContainer } from "../styledComponents/hightlightedContainer";
import { InfoContainer } from "../styledComponents/infoContainer";

import { HiOutlineLightBulb } from "react-icons/hi";
import bird02 from "../assets/birbs/02_Robin_American.png";
import bird03 from "../assets/birbs/03_Robin_European.png";
import bird04 from "../assets/birbs/04_Chickadee_Black-caped.png";

export default function Feed() {
  return (
    <div>
      <Title>Feed</Title>
      <InfoContainer>
        <div className="bulbIcon">
          <HiOutlineLightBulb />
        </div>
        <div>
          3 little Birbs fluttered to your doorstep. They brought 3 good things
          and kind words with them.
        </div>
      </InfoContainer>
      <MainContainer>
        Serwas!
        <GoodThingContainerBirdLeft>
          <div><img className="birdImg" src={bird02} alt="hi"></img></div>
          <div>Vogerl 1</div>
        </GoodThingContainerBirdLeft>
        <GoodThingContainerBirdRight>
        <div><img className="birdImg" src={bird03} alt="hi"></img></div>
          <div>Vogerl 2</div>
        </GoodThingContainerBirdRight>
        <GoodThingContainerBirdLeft>
        <div><img className="birdImg" src={bird04} alt="hi"></img></div>
          <div>Vogerl 3</div>
        </GoodThingContainerBirdLeft>
        <HighlightedContainer>Highlighted</HighlightedContainer>
      </MainContainer>
      <InfoContainer>
        <div className="bulbIcon">
          <HiOutlineLightBulb />
        </div>
        <div>
          What was good about today? Name 3 things, and send them to strangers,
          or to a friend.
        </div>
      </InfoContainer>

      <div className="buttonContainer">
        <Button>Button</Button>
      </div>
    </div>
  );
}
